Proprietors: Kammath &amp; Kammath is a 2013 Malayalam action-comedy film written by Udayakrishna-Siby

K. Thomas, directed by Thomson K. Thomas and produced by Anto Joseph. The film features Mammootty

and Dileep in the title roles and Karthika Nair, Rima Kallingal and Narain in supporting roles.

Tamil film actor Dhanush has a cameo role in the film as himself.
